import React from 'react';

import './todo.css';

function App() {
  return (
    <div className="App">
      <form>
          <label>
            Title
            <input type="text"></input>
          </label>
          <label>
            Task
            <input type="text"></input>
          </label>
          <label>
            Color
            <input type="color"></input>
          </label>
          <button type="submit">Submit</button>
        </form>
    </div>
  );
}

export default App;
